window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"26.0.0","implementation":{"version":"7.4.0 (playwright 1.47.2)","name":"playwright-bdd"},"cpu":{"name":"arm64"},"os":{"name":"darwin","version":"23.4.0"},"runtime":{"name":"node.js","version":"20.17.0"}}},{"source":{"data":"Feature: Playwright site\n\n\n    Scenario:User logins the web application\n        Given Navigate to Login Page\n        \n\n   \n\n\n\n\n# Use @only tag to run a single feature \/ scenario:\n# Use @skip (or @fixme) tag to skip a particular feature \/ scenario:\n# Use @fail tag to mark feature \/ scenario as failing:\n# Use @timeout:5000   5s example  tag to set scenario timeout:\n# Use @retries:N tag to set retries for all scenarios in a feature:      1 ,2    @retries:2 yada sadece bir scnerio icin\n# Use one of the following tags to set execution mode for the feature or scenario outline: @mode:parallel   @mode:serial   @mode:default\n# Please note that @mode tag is not applicable to a single scenario\n\n\n#.vscode\/settings.json fileinda  given uzerine tiklayinca stepslere ulasabilmemiz icin gerekli ayar eklendi , cucumber plugin kurulumunda eklenmesi gerekiyordu\n\n \n\n\n\n\n\n\n","uri":"[chromium]:.cucumber\/features\/notes.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"source":{"data":"\n\nFeature:Main Page Modules and their functionality\n\n  Background:\n    \n  Given Navigate to Dashboard \"english\"\n  Then verify that dashboard page tab name contains QUGEM\n\n  Scenario:navigation to Dashboard Module\n  \n    And verify DashBoard Module Button is visible and is Clickable\n    Then click the Dashboard module\n    And verify the URL of the dashboard should be \"https:\/\/qugem-staging.netlify.app\/\"\n    And I should see the message \"Hello, welcome to the QUGEM homepage.\"\n\n\n  Scenario:navigation to Employee_Master_data module\n    Then verify Employee_Master_Data module button is visible and is Clickable\n\n    Then click the Employee_Master_data module\n    And verify the URL of the Employee_Master_data module should be \"https:\/\/qugem-staging.netlify.app\/employee\"\n\n  Scenario:navigation to Employee_Attendance module\n    Then verify Employee_Attendance Module Button is visible and is Clickable\n    Then click the Employee_Attendance module\n    And verify the URL of the Employee_Master_data module module should be \"https:\/\/qugem-staging.netlify.app\/employee\/attendance\"\n\n\n\n  Scenario:navigation to Payroll module\n    Then verify Payroll Module Button is visible and is clickable\n    Then click the Payroll module\n    And verify the URL of the Employee_Master_data module module should be \"https:\/\/qugem-staging.netlify.app\/salary\"\n\n\n  Scenario:navigation to Vehicles module\n    Then verify Vehicles Module Button is visible and is clickable\n    Then click the Vehicles module\n    And verify the URL of the Employee_Master_data module module should be \"https:\/\/qugem-staging.netlify.app\/auto\"\n\n\n\n  Scenario:navigation to Admin_Users module\n    Then verify Admin Module Button is visible and is clickable\n    Then click the Admin Module\n    Then verify Users module button is visible and clickable\n    And click the Users Module \n    And verify the URL of the Users module should be \"https:\/\/qugem-staging.netlify.app\/admin\/users\"\n\n Scenario:navigation to Admin_Options module\n    And verify Admin Module Button is visible and is clickable\n    Then click the Admin Module\n    Then verify Options module button is visible and clickable\n    And click the Options Module \n    And verify the URL of the Options module should be \"https:\/\/qugem-staging.netlify.app\/admin\/options\"\n    \n  \n   Scenario:navigation to Admin_Holidays module\n    And verify Admin Module Button is visible and is clickable\n    Then click the Admin Module\n    Then verify Holidays module button is visible and clickable\n    And click the Holidays Module \n    And verify the URL of the Holidays module should be \"https:\/\/qugem-staging.netlify.app\/admin\/holidays\"\n\n    Scenario:navigation to Admin_Payout_amounts module\n    And verify Admin Module Button is visible and is clickable\n    Then click the Admin Module\n    Then verify Payout_amounts module button is visible and clickable\n    And click the Payout_amounts Module \n    And verify the URL of Payout_amounts module should be \"https:\/\/qugem-staging.netlify.app\/admin\/payoutAmounts\"\n\n\nScenario:navigation to Quickly_Gmbh module\n    Then verify Quickly_Gmbh Module Button is visible and is clickable\n    Then click the Quickly_Gmbh Module\n    And verify new opened Tab title contains \"Quickly Transporte GmbH\"\n    And verify the Quickly_Gmbh URL should be \"https:\/\/quicklygmbh.de\/\"\n   \n\nScenario:navigation to Kinesis GPS module\n    Then verify Kinesis GPS Module Button is visible and is clickable\n    Then click the Kinesis GPS Module\n    And verify new opened Tab contains \"Radius Velocity\"\n    And verify the URL should be \"https:\/\/www.velocityfleet.com\/accounts\/login\/\"\n","uri":"[chromium]:.cucumber\/features\/dashboard.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"source":{"data":"Feature:Testing Navigation Success with valid and invalid credentials\n\n  Background:\n    Given  Navigate to Login Page\n\n  Scenario:1-User Logs In, Navigates to Dashboard, and Logs Out\n\n    Then Enter a valid email\n    Then Enter a valid password\n    Then Click the login button after choosing english language\n    And  Verify that user is now on the Dasboard Page url after clicking login\n    Then verify that dashboard page tab name contains QUGEM\n    Then Click the sign out button and verify you are in sign in page again\n\n  Scenario Outline:2- User cannot login with invalid passwords and valid email\n    Then Enter a valid email\n    Then Enter an invalid \"<password>\"\n    Then Click the login button with \"english\" language\n    And  Verify that user is not on the Dasboard Page after clicking login button\n      #!'Bitte geben Sie eine korrekte E-Mail-Adresse ein.'   2 tane bug --it had to be english  and  warning should be for password , not for email\n    And  verify user gets right alert warning if invalid password and valid email used in right language\n\n    Examples:\n      | password |\n      | 123txt_  |\n      | 1234567  |\n\n  \n  Scenario Outline:3- User cannot login with a short password less than 6 characters\n    Then Enter a valid email\n    Then Enter an invalid \"<shortpassword>\"\n    Then click login button is functional\n    Then press enter keyboard button\n    # \"parametre icin\"          \"<examples icin>\"clear\n    Then choose the \"<langauge>\" in loginPage\n    And verify that user gets an alert for pasword and alert is in right language \"<alert>\"\n\n\n    Examples:\n      | shortpassword | langauge | alert                               |\n      | wd32          | english  | Must be at least 6 characters long  |\n      | 12345         | türkish  | En az 6 karakter olmalıdır          |\n      | abc           | german   | Muss mindestens 6 Zeichen lang sein |\n\n","uri":"[chromium]:.cucumber\/features\/login_And_navigationToDashboard.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Playwright site","description":"","children":[{"scenario":{"id":"ded9de1e-f8af-4ab6-9f2e-81edc97a0fd7","tags":[],"location":{"line":4,"column":5},"keyword":"Scenario","name":"User logins the web application","description":"","steps":[{"id":"81381791-9d31-4817-abcf-468825669f93","location":{"line":5,"column":9},"keyword":"Given ","keywordType":"Context","text":"Navigate to Login Page"}],"examples":[]}}]},"comments":[{"location":{"line":13,"column":1},"text":"# Use @only tag to run a single feature \/ scenario:"},{"location":{"line":14,"column":1},"text":"# Use @skip (or @fixme) tag to skip a particular feature \/ scenari
